	(867,'Check UKFast','Hi\r\n\r\nI wonder if u can have a quick look at the UK Fast server for me today.\r\n\r\nTheres nothing wrong so far, but Grand National traffic is currently running at 2x last year which means we are expecting 400-500,000 visitors both today and tomorrow\r\n\r\nThe site was rewritten about 15 months ago so is nearly all static html that is updated by cron every 5-10 minutes and Im happy with that (and in fact its too late to do anything about it anyway). Also we had the server upgraded too so has 8GB Ram now and  Intel(R) Xeon(R)CPU X3360 @ 2.83GHz.  Load (per Plesk) was under 1 all day yesterday (but today is a whole other level of traffic)\r\n\r\nHowever the one area that does worry me is global server settings.  The one I know about is Apache \"Too many connections\" which in my experience can be hit even if the server isnt maxed out.   Would you be able to take a look at this please (and any other such settings) to see both where we are on load and what sort of limits we have.  By lunchtime today (say 3pm your time) things should be pretty high.\r\n\r\nLike I said Im not really worried on the mysql side, its on the serving of html pages that Im concerned.\r\n\r\nWe currently use gz compression but can turn it off with a click, and have htaccess rewriting most url requests, and we can also easily turn off some images too if we need to limit the volume of data transfer.\r\n\r\nMy main fear is that we go down for an hour because of \"too many connections\" even if the server isnt loaded, or anything else similar you can thing of.\r\n\r\nWe were fine last year, but with 2x the traffic something may break\r\n\r\nThe server is 78.109.163.154\r\nThe site is grand-national-guide.co.uk\r\n\r\nLike I said all is fine so strictly no experimentation :)\r\n\r\nNext year Im thinking The Cloud :)\r\n\r\nThanks\r\n\r\nA',2,'2011-04-08',1,'2011-04-08 08:14:02','2011-04-08 14:47:46',2,1,'2011-04-08 08:13:00','2011-04-08 08:13:00',0,1,NULL),
