	(1122,'Contestar mail Pia','No aconseguim treballar els banners destacados.\r\n1. 3 no hi caben, ens sembla, o ara, amb 3 no es llegeixen bé.\r\n2. els banners destacados són a les seccions. I a les subseccions?\r\n3. com podem fer diferents banners destacados per a cada secció, que no es repeteixin sempre els mateixos? no aconseguim trobar la manera de relacionar-los a cada secció. Penso que és millor primer crear-los tots i després, mirar de relacionar-los a la secció que volem, oi? Hem intentat fer des de cada secció, i no podem. També hem fet Elementos secundarios / Baners destacados / Lista, i entrar a cadascun d\'elll per tal de poder relacionar amb la secció que volem. D\'aquesta darrera manera, no trobem la forma d\'enllaçar amb la secció. Quina és la millor manera?\r\nDes 24 Destacados no podem fer-ho, oi? O com es fa?',1,'2011-04-18',1,'2011-04-18 08:55:23','2011-04-18 10:06:00',270,119,'2011-04-18 08:55:00','2011-04-18 08:55:00',0,0,NULL),
