	(1380,'Gilbert - Prepaid Legal - Con-call re: HATS training for portlets?','Call Gilbert and set a time. Any prep? Then, tell Steve.\r\n\r\nPre-paid legal is a technical dialogue of what HATS can do.  No, we do not need to demo portlets but need to understand what they want to do with portlets.  Gilbert told me some weeks ago we will have to load a WebSphere instance and download WebSphere portal.   So that won’t and can’t happen before a dialogue.  Gilbert keeps a bunch of HATS demos handy… both Porsche and KPG which he uses to frame technical discussions.   The prep time should be minimal… and I already sent him a powerpoint of portlet capabilities.   I believe Pre-Paid need our custom training.. I don’t know what else they have in mind but they are a qualified prospect.',1,'2011-05-20',0,'2011-04-26 16:41:51','2011-05-03 01:22:32',305,191,'2011-05-20 16:40:00','2011-05-20 16:40:00',0,0,''),
