	(1396,'Quote Okapi','Am un proiect (ma rog, nu e chiar al meu, eu actionez ca advisor tehnic in primul rand la el) si m-am gandit sa te contactez pentru o cotatie de design si development (la recomandarea lui Radu).\r\n\r\nE un site de social networking combinat cu video sharing specializat pe film schools si film students (nu, nu suntem concurenti ai Facebook sau ale altor relele sociale).\r\nIn viitor, daca treaba merge cu film schools vom incerca sa ne extindem si la alte arte creative.\r\n\r\n\r\nProiectul se gaseste la adresa asta: http://flairbuilder.com/viewer/?sid=rMUB62hucR\r\n \r\nE un full mockup, construit cu Flairbuilder.com, clickable (poti da click cam pe orice ti se pare clickable: butoane, links). Vei vedea functionalitatea lui in principal.\r\nProiectul e impartit pe doua parti: user front end (ceea ce vede userul) si admin backend (ceea ce vede administratorii la Administration)\r\n\r\nAcum ma intereseaza cotatii de pret pe urmatoarele lucruri:\r\n\r\n1) Cotatie pe design la user front end (nu ma intereseaza design la admin backend)\r\n\r\nCotatia pe design se imparte in doua parti:\r\n- cotatie pentru design puse in fisiere PSD sau/si PNG - in cat timp se face si cat costa\r\n- cotatie pentru design puse in fisiere SI mai apoi facute HTML/CSS/ (deci inca un pas in plus)  - in cat timp se face si cat costa\r\n\r\n\r\n2) Cotatie pe development\r\n\r\nBaza de date va fi MySQL, nu conteaza ce tehnologie de scripting folosim.\r\nTehnologia de scripting va fi una open source: PHP (poate si un framework de PHP daca se crede necesar), Ruby on Rails say Python/Django.\r\n\r\nVoi am inteles ca sunteti axati pe Ruby on Rails, da? Sau sunteti si cu alte tehnologii din astea de mai sus? Daca da, pretul e acelasi pentru oricare  din ele?\r\n\r\nDevelopmentul va fi pentru user front end si pentru admin backend  - in cat timp se face si cat costa fiecare\r\n\r\nO mentiune speciala e pentru sectiunea de Video.\r\nAm zis sa utilizam Brightcove.com pentru hosting, transcoding and video delivery using their CDN...dar informatiile despre video (video metadata) o sa le punem la noi in baza de date).\r\nDeci nu va trebui voi sa executati partea de transcoding (FFMPEG e o solutie open source dar deocamdata ne-am gandit ca la inceput sa apelam la Brightcove).\r\n\r\n\r\nTe rog uita-te cu atentie peste proiect. Fiecare click contine informatie despre actiunea care se presupune ca ar fi executata daca proiectul ar fi un site live.\r\nNu doresc o cota in 2-3 zile...daca poti saptamana asta sa te uiti peste el si sa-mi dai cotele la inceputul saptamanii viitoare atunci e ok.\r\n\r\nNoi suntem acum in faza de a strange cote de pret...ca mai apoi sa decidem cu cine vom merge. Intentionam sa incepem designul/developmentul cam intr-o luna...designul poate ceva mai devreme de o luna.',4,'2011-04-27',1,'2011-04-27 09:14:00','2011-04-29 06:20:03',325,1,'2011-04-27 09:12:00','2011-04-27 09:12:00',0,0,NULL),
