	(1481,'Filtrar las historias por su estado','Los estados actuales de una historia son: SIN HACER, EN POGRESO, HECHA y CERRADA.\r\n\r\nPor defecto se mostrarán todas las historias, pero se podrá ocultar aquellas historias cuyo estado no se desea tener en cuenta.',4,'2011-04-30',1,'2011-04-30 10:53:08','2011-04-30 17:27:49',351,93,'2011-04-30 10:51:00','2011-04-30 10:51:00',0,0,NULL),
	(1482,'Crear un nuevo Sprint','Para crear un nuevo Sprint se requiere sólo de un nombre que no haya sido seleccionado previamente. El sistema por defecto debe sugerir un nombre, que se formará con la cadena \'Sp#\' y el número de Sprint actual.\r\n\r\nUna vez creado un Sprint se podrán modificar los siguientes campos: nombre, fecha de inicio (por defecto sin definir), fecha de fin (por defecto sin definir), número de puntos previstos a implementar.',4,'2011-04-30',0,'2011-04-30 10:56:07','2011-04-30 10:56:07',351,93,'2011-04-30 10:53:00','2011-04-30 10:53:00',0,0,NULL),
	(1483,'Añadir una historia a un Sprint','Toda historia puede estar asociada a un único Sprint. Se debe poder asignar una historia a un Sprint, cambiar la historia de Sprint y eliminar del Sprint.\r\n\r\nUna historia asignada a un Sprint debería poder identificarse con facilidad, por ejemplo, mostrando en la ficha de la historia el Sprint al que pertenece.\r\n\r\nLa ficha de Sprint debe mostrar informarción sobre las historias asignada: número de puntos que suman todas sus historias, número de puntos completados de todas sus hitorias.',4,'2011-04-30',0,'2011-04-30 10:59:06','2011-04-30 10:59:06',351,93,'2011-04-30 10:56:00','2011-04-30 10:56:00',0,0,NULL),
	(1484,'Historias en curso o concepto de pizarra','Poder mostrar la pizarra de trabajo actual. Se formará por las historias de los Sprints iniciados que aun no han finalizado (Sprints en curso).',4,'2011-04-30',0,'2011-04-30 11:02:19','2011-04-30 11:03:24',351,93,'2011-04-30 10:59:00','2011-04-30 10:59:00',0,0,NULL),
	(1485,'Layout','Layout limpio con las siguientes secciones: las historias, el filtro por estado, los sprints y la botonera para crear nueva historia y nuevo sprint.',4,'2011-04-30',1,'2011-04-30 11:17:47','2011-04-30 12:29:37',351,93,'2011-04-30 11:16:00','2011-04-30 11:16:00',0,0,NULL),
