	(2575,'Mejora en Froitas Xeitosiña','  David me dice:\r\n  Ya lo habíamos hablado en su momento, pero ahí quedó: actualmente, en la web de FX, cuando un producto no está publicado e intentas acceder a él, te devuelve un \r\n  Error 404. Esto podría dar problemas, por ejemplo, si un post del blog enlaza a un producto y se trata de pinchar en él fuera de temporada. Habría que pensar en algún\r\n  mecanismo que permitiera distinguir si está accediendo a un producto despublicado y devolviera otro mensaje, del tipo \"El producto al que intentas acceder no está\r\n  disponible actualmente\" (o aljo paresido). No sé cuál sería la mejor forma de gestionar esto. A lo mejor habría que crear un campo diferente al de \r\n  publicado/despublicado para gestionar este tema y filtrarlo después en la vista, o igual vale la pena mantener el campo y tirar por otro lado, no lo sé...\r\n\r\n  Mi Opinión sobre el tema:\r\n  Habrá que decidir si lo hacemos en base al término de la taxonomía que sirve para marcar productos fuera de temporada o si lo hacemos por el campo \"status\" de la tabla\r\n  \"node\" que sirve para diferenciar si un nodo está o no publicado. Esto último parece lo más lógico, porque siempre puede pasar que el producto no esté publicado\r\n  y hay un enlace en el blog o lo que sea hacia ese producto. En este último caso, la mejor forma de hacerlo parece usar lo que hacen en el módulo \"view_unpublished\".\r\n  A continuación copio aquí la parte interesante de ese código:\r\n\r\n/**\r\n * Implementation of hook_menu_alter().\r\n *\r\n * Modifies the path node/nid to use our access callback.\r\n */\r\nfunction view_unpublished_menu_alter(&$items) {\r\n  $old_access_callback = $items[\'node/%node\'][\'access callback\'];\r\n  $items[\'node/%node\'][\'access callback\'] = \'_view_unpublished_node_access\';\r\n  $items[\'node/%node\'][\'access arguments\'] = array(1, $old_access_callback);\r\n}\r\n\r\n/**\r\n * Returns true if the user has \'view all unpublished content\' or if\r\n * they have the permission corresponding to the node\'s content type.\r\n */\r\nfunction _view_unpublished_node_access($node, $old_access_callback = \"node_access\") {\r\n  // Only check permissions on nodes that are unpublished.\r\n  if ($node->status == 0) {\r\n    if (user_access(\'view all unpublished content\')) {\r\n      return TRUE;\r\n    }\r\n\r\n    if (user_access(\'view unpublished \' . $node->type . \' content\')) {\r\n      return TRUE;\r\n    }\r\n  }\r\n  // If none of the above conditions were satisfied, then use the normal callback.\r\n  return $old_access_callback(\'view\', $node);\r\n}\r\n\r\n\r\n\r\nHabría que adaptar el código anterior, de modo que, si el nodo que se quiere ver existe y no está publicado, si el usuario que quiere verlo tiene el rol \"anonymous\" (es cuando el id de usuario es cero, creo recordar) o simplemente \"authenticated\" pero no tiene los roles \"editor\" ni \"administrador\", entonces se le debería redirigir a una página que le explique que el producto está fuera de temporada, mientras que en cualquier otro caso se debería usar el \"old_access_callback\".',4,'2012-01-01',0,'2011-06-01 09:44:26','2011-06-08 17:16:15',605,254,'2012-01-01 10:43:00','2012-01-01 10:43:00',0,0,''),
