	(3001,'Mejora en fecha de entrega/recogida en Froitas Xeitosiña','Hacer que la fecha de entrega/recogida de los pedidos tenga en cuenta que sólo hasta las 21:00 horas es posible hacer pedidos y que te los entreguen al día siguiente.\r\n\r\n1. Los pedidos realizados hasta las 21:00h deben mostrar como fecha de entrega/recogida por defecto el día siguiente.\r\n2. Los pedidos realizados después de las 21:00h deben mostrar como fecha de entrega/recogida por defecto la de dos días después.\r\n3. Si se cambia manualmente la fecha y se intenta poner una fecha anterior a la indicada en 1 y en 2 (según el caso), el sistema debería dar un error por medio de un validador del formulario.',4,'2011-06-17',1,'2011-06-16 14:01:42','2011-06-17 09:03:42',605,254,'2011-06-17 14:00:00','2011-06-17 14:00:00',0,0,''),
