	(3051,'Proteger cron de usuarios anónimos','Actualmente, cualquier usuario anónimo puede ejecutar la URL: [http://www.froitasxeitosina.com/cron.php] causando la ejecución de script cron.php de Drupal. Hay que intentar evitar esto y la forma más sencilla parece hacerlo desde el .htaccess, según lo indicado en: [http://drupal.org/node/41049]. Esto seguramente habrá que hacerlo en el .htaccess del directorio raíz del servidor para que funcione. Hacer pruebas y ver que se impide el acceso a cualquier usuario anónimo pero que se sigue ejecutando cuando se tiene que ejecutar.\r\n\r\nSiguiendo las indicaciones de la URL indicada en el párrafo anterior, modifiqué el .htaccess para que sólo el servidor pudiese ejecutar el cron.php. No llegó con poner la IP 127.0.0.1 ni \"localhost\" y tuve que poner la IP del servidor, que en principio no debería cambiar.',3,'2011-06-20',1,'2011-06-19 12:26:51','2011-06-20 09:53:42',605,254,'2011-06-20 12:24:00','2011-06-20 12:24:00',0,0,''),
