	(23,'Sometimes I have activities that span several days, and in those cases the estimates for that day are not very relevant. What if I could limit the estimate for tasks scheduled for today. \r\nIt could work like this:\r\n  * Pick task for today\r\n  * The full estimate shows\r\n  * I mouseover and see part of the estimate greyed out depending on where my mouse is in the list of empty pomodoros\r\n  * After I click an empty pomodoro the selection is confirmed and this is taken as today\'s estimate\r\n  * The total is still shown but part of the pomodoro\'s are greyed out.\r\n\r\nWould make for a fairly inituitive UI I\'d say. :-)\r\n\r\n-Aschwin',0,0,1,30,'2011-04-05 17:01:34','2011-04-05 17:01:34','<code class=\'debug_dump\'>{\"SERVER_SOFTWARE\"=>\"Apache/2.2.3 (CentOS)\", \"SERVER_PROTOCOL\"=>\"HTTP/1.1\", \"SERVER_NAME\"=>\"pomodorocrate.com\", \"SERVER_ADMIN\"=>\"tech@easymedia.ro\", \"SERVER_ADDR\"=>\"195.216.222.67\", \"SERVER_PORT\"=>\"80\", \"REMOTE_ADDR\"=>\"84.250.39.239\", \"REMOTE_PORT\"=>\"59161\", \"REQUEST_METHOD\"=>\"GET\", \"QUERY_STRING\"=>\"\", \"DOCUMENT_ROOT\"=>\"/var/www/vhosts/pomodorocrate.com/rails/pomodorocrate/current/public/\", \"REQUEST_URI\"=>\"/contact_requests/new\", \"SCRIPT_NAME\"=>\"\", \"PATH_INFO\"=>\"/contact_requests/new\", \"HTTP_HOST\"=>\"pomodorocrate.com\", \"HTTP_USER_AGENT\"=>\"Mozilla/5.0 (Windows NT 5.1; rv:2.0) Gecko/20100101 Firefox/4.0\", \"HTTP_ACCEPT\"=>\"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8\", \"HTTP_ACCEPT_LANGUAGE\"=>\"en-us,en;q=0.5\", \"HTTP_ACCEPT_ENCODING\"=>\"gzip, deflate\", \"HTTP_ACCEPT_CHARSET\"=>\"ISO-8859-1,utf-8;q=0.7,*;q=0.7\", \"HTTP_KEEP_ALIVE\"=>\"115\", \"HTTP_CONNECTION\"=>\"keep-alive\", \"HTTP_REFERER\"=>\"http://pomodorocrate.com/todotodays\", \"HTTP_COOKIE\"=>\"__utma=193383474.2129310431.1300606812.1301496244.1302022640.24; __utmz=193383474.1300951327.4.2.utmcsr=google|utmccn=(organic)|utmcmd=organic|utmctr=pomodorocrate; remember_token=BAhbB2kjIkVhZjU1MmIyMGU