	(39,'Hi Guys great job! \r\nI was planning to write my own rails app for keeping track of my pomodori.  After a day in sketching and planning... I got a better idea: check first if there is something out there that I missed last time I checked (more than two years ago).\r\nFinally Pomodoro Crate is very similar to how I dreamed it.  You avoided me to waste many pomodori in reinventing the wheel.\r\nThank you!',0,0,0,198,'2011-04-29 16:09:43','2011-04-29 16:09:43','<code class=\'debug_dump\'>{\"SERVER_SOFTWARE\"=>\"Apache/2.2.3 (CentOS)\", \"SERVER_PROTOCOL\"=>\"HTTP/1.1\", \"SERVER_NAME\"=>\"pomodorocrate.com\", \"SERVER_ADMIN\"=>\"tech@easymedia.ro\", \"SERVER_ADDR\"=>\"195.216.222.67\", \"SERVER_PORT\"=>\"80\", \"REMOTE_ADDR\"=>\"128.178.70.170\", \"REMOTE_PORT\"=>\"58862\", \"REQUEST_METHOD\"=>\"GET\", \"QUERY_STRING\"=>\"\", \"DOCUMENT_ROOT\"=>\"/var/www/vhosts/pomodorocrate.com/rails/pomodorocrate/current/public/\", \"REQUEST_URI\"=>\"/contact_requests/new\", \"SCRIPT_NAME\"=>\"\", \"PATH_INFO\"=>\"/contact_requests/new\", \"HTTP_HOST\"=>\"pomodorocrate.com\", \"HTTP_USER_AGENT\"=>\"Mozilla/5.0 (Macintosh; U; Intel Mac OS X 10_6_7; en-us) AppleWebKit/533.21.1 (KHTML, like Gecko) Version/5.0.5 Safari/533.21.1\", \"HTTP_ACCEPT\"=>\"application/xml,application/xhtml+xml,text/html;q=0.9,text/plain;q=0.8,image/png,*/*;q=0.5\", \"HTTP_REFERER\"=>\"http://pomodorocrate.com/todotodays\", \"HTTP_ACCEPT_LANGUAGE\"=>\"en-us\", \"HTTP_ACCEPT_ENCODING\"=>\"gzip, deflate\", \"HTTP_IF_NONE_MATCH\"=>\"\\\"1bf330e829219b42984bf675ddf5bb49\\\"\", \"HTTP_COOKIE\"=>\"__utmb=193383474.5.10.1304092407; __utmc=193383474; __utma=193383474.117390023.1304089236.1304089236.1304092407.2; __utmz=193383474.1304089236.1.1.utmcsr=google|utmccn=(organic)|utmcmd=organic|utmctr=web%20based%20pomodoro%20technique; _ketchup_session=BAh7B0kiD3Nlc3Npb25faWQGOgZFRiIlOWJkODYxNWQ1ZTU0MDc1YWM1OWFjZTkxYTBjMDIxNjRJIhBfY3NyZl90b2tlbgY7AEZJIjFFMFRGVEV1WEJZbkl0cHNGbkNGdFMwdy9YSC8wNHJHUnhzWlovRWhXYUtFPQY7AEY