	(40,'Would be nice to have something like a list of checkboxes with options for new activity deadline as an alternative or in addition to the standard calendar selector. \r\nI\'d like to have a choice like:\r\n\"by tomorrow\"\r\n\"before the end of the week\"\r\n\"in a month\"\r\n\"sooner or later...\" (no deadline)\r\n...\r\n\r\nthanks! started to add some activity and the system looks great.',0,1,0,198,'2011-04-29 19:52:39','2011-04-29 19:52:39','<code class=\'debug_dump\'>{\"SERVER_SOFTWARE\"=>\"Apache/2.2.3 (CentOS)\", \"SERVER_PROTOCOL\"=>\"HTTP/1.1\", \"SERVER_NAME\"=>\"pomodorocrate.com\", \"SERVER_ADMIN\"=>\"tech@easymedia.ro\", \"SERVER_ADDR\"=>\"195.216.222.67\", \"SERVER_PORT\"=>\"80\", \"REMOTE_ADDR\"=>\"212.41.113.74\", \"REMOTE_PORT\"=>\"59537\", \"REQUEST_METHOD\"=>\"GET\", \"QUERY_STRING\"=>\"\", \"DOCUMENT_ROOT\"=>\"/var/www/vhosts/pomodorocrate.com/rails/pomodorocrate/current/public/\", \"REQUEST_URI\"=>\"/contact_requests/new\", \"SCRIPT_NAME\"=>\"\", \"PATH_INFO\"=>\"/contact_requests/new\", \"HTTP_HOST\"=>\"pomodorocrate.com\", \"HTTP_USER_AGENT\"=>\"Mozilla/5.0 (Macintosh; U; Intel Mac OS X 10_6_7; en-us) AppleWebKit/533.21.1 (KHTML, like Gecko) Version/5.0.5 Safari/533.21.1\", \"HTTP_ACCEPT\"=>\"application/xml,application/xhtml+xml,text/html;q=0.9,text/plain;q=0.8,image/png,*/*;q=0.5\", \"HTTP_REFERER\"=>\"http://pomodorocrate.com/activities/new\", \"HTTP_ACCEPT_LANGUAGE\"=>\"en-us\", \"HTTP_ACCEPT_ENCODING\"=>\"gzip, deflate\", \"HTTP_IF_NONE_MATCH\"=>\"\\\"2144e2d71639fc563b8199a9b5d9911c\\\"\", \"HTTP_COOKIE\"=>\"__utmb=193383474.31.10.1304105265; __utmc=193383474; __utma=193383474.117390023.1304089236.1304092407.1304105265.3; __utmz=193383474.1304089236.1.1.utmcsr=google|utmccn=(organic)|utmcmd=organic|utmctr=web%20based%20pomodoro%20technique; _ketchup_session=BAh7B0kiD3Nlc3Npb25faWQGOgZFRiIlOWJkODYxNWQ1ZTU0MDc1YWM1OWFjZTkxYTBjMDIxNjRJIhBfY3NyZl90b2tlbgY7AEZJIjFFMFRGVEV1WEJZbkl0cHNGbkNGdFMwdy9YSC8wNHJHUnhzWlovRWhXYUtFPQY7AEY%3D--2b893ee