	(42,'When selecting tasks for today, I somehow intuitively tick the checkbox. Of course I know that this closes the task, but I keep making this mistake.\r\n\r\nSelecting tasks to be done today is a 2 click operation atm, I suggest making it a one click operation. Additionally, perhaps it should be made more clear (somehow) that the checkbox closes a task. \r\n\r\nI don\'t have any good suggestions though. Perhaps a mouse-over would do something to clarify it. E.g. reveal \'Close task\' and \'do today\' buttons.\r\n\r\nAdditionally when making the mistake of closing the task, it vanishes to the done pile. Perhaps that should only happen for tasks that are in the past. That way it is more clear which tasks I had planned for today and later I actually completed.',0,0,1,30,'2011-05-07 08:30:34','2011-05-07 08:30:34','<code class=\'debug_dump\'>{\"SERVER_SOFTWARE\"=>\"Apache/2.2.3 (CentOS)\", \"SERVER_PROTOCOL\"=>\"HTTP/1.1\", \"SERVER_NAME\"=>\"pomodorocrate.com\", \"SERVER_ADMIN\"=>\"tech@easymedia.ro\", \"SERVER_ADDR\"=>\"195.216.222.67\", \"SERVER_PORT\"=>\"80\", \"REMOTE_ADDR\"=>\"84.250.39.239\", \"REMOTE_PORT\"=>\"50648\", \"REQUEST_METHOD\"=>\"GET\", \"QUERY_STRING\"=>\"\", \"DOCUMENT_ROOT\"=>\"/var/www/vhosts/pomodorocrate.com/rails/pomodorocrate/current/public/\", \"REQUEST_URI\"=>\"/contact_requests/new\", \"SCRIPT_NAME\"=>\"\", \"PATH_INFO\"=>\"/contact_requests/new\", \"HTTP_HOST\"=>\"pomodorocrate.com\", \"HTTP_USER_AGENT\"=>\"Mozilla/5.0 (Windows NT 5.1; rv:2.0.1) Gecko/20100101 Firefox/4.0.1\", \"HTTP_ACCEPT\"=>\"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8\", \"HTTP_ACCEPT_LANGUAGE\"=>\"en-us,en;q=0.5\", \"HTTP_ACCEPT_ENCODING\"=>\"gzip, deflate\", \"HTTP_ACCEPT_CHARSET\"=>\"ISO-8859-1,utf-8;q=0.7,*;q=0.7\", \"HTTP_KEEP_ALIVE\"=>\"115\", \"HTTP_CONNECTION\"=>\"keep-alive\", \"HTTP_REFERER\"=>\"http://pomodorocrate.com/activities\", \"HTTP_COOKIE\"=>\"__utma=193383474.2129310431.1300606812.1304714137.1304756178.103; __utmz=193383474.1