	(54,'Beautiful site! Thanks for the wonderful resource.\r\n\r\nFirst off please do not have this form disappear if you click outside its bounds. I lost a huge message with lots of info I\'ll try to replicate again but without all the detail so please excuse the brevity.\r\n\r\nAlso with this form; as you type the \"Get In Touch\" button disappears. I\'m using Google Chrome 11.0.696.71\r\n\r\nMore control over the timer. It should have \"fast forward.\" If I finish 5 mins into the next work period I\'m not sitting around for 20 mins. I want to start and document my next task. I don\'t stick to the pomodoro immutability thing though so take it with a grain of salt.\r\n\r\nUnclear at first on how to start break period. Thought break period buttons were just indicators of the settings not actual start break buttons. They seem out of the normal workflow.\r\n\r\nIf you need to add pomodoro\'s to a taks because you didn\'t finish it the way to do this is not clear.\r\n\r\nThanks again for the great resource. The site is really beautifully designed (even with the few usability hiccups).\r\n\r\nMike',1,1,1,314,'2011-06-01 03:03:54','2011-06-01 03:03:54','<code class=\'debug_dump\'>{\"SERVER_SOFTWARE\"=>\"Apache/2.2.3 (CentOS)\", \"SERVER_PROTOCOL\"=>\"HTTP/1.1\", \"SERVER_NAME\"=>\"pomodorocrate.com\", \"SERVER_ADMIN\"=>\"tech@easymedia.ro\", \"SERVER_ADDR\"=>\"195.216.222.67\", \"SERVER_PORT\"=>\"80\", \"REMOTE_ADDR\"=>\"68.202.59.144\", \"REMOTE_PORT\"=>\"55005\", \"REQUEST_METHOD\"=>\"GET\", \"QUERY_STRING\"=>\"\", \"DOCUMENT_ROOT\"=>\"/var/www/vhosts/pomodorocrate.com/rails/pomodorocrate/current/public/\", \"REQUEST_URI\"=>\"/contact_requests/new\", \"SCRIPT_NAME\"=>\"\", \"PATH_INFO\"=>\"/contact_requests/new\", \"HTTP_HOST\"=>\"pomodorocrate.com\", \"HTTP_CONNECTION\"=>\"keep-alive\", \"HTTP_REFERER\"=>\"http://pomodorocrate.com/users/314/edit\", \"HTTP_USER_AGENT\"=>\"Mozilla/5.0 (Macintosh; Intel Mac OS X 10_6_7) AppleWebKit/534.24 (KHTML, like Gecko) Chrome/11.0.69