	(56,'Often I don\'t actually need to have tasks sorted by date, and I\'d rather have them sorted by priority without date. Although sometimes a combination might be useful.\r\n\r\nThis causes me to reschedule a lot which is a four step operation at the moment, but could be reduced to two steps. E.g. by adding a calendar button to the main view (after clicking on a task).\r\n\r\nAdditionally, it would be nice to have tasks that are not tied to a date. They could for instance allways be shown for today or otherwise in their own category \'unscheduled\' in the top of the page.',0,0,1,30,'2011-06-04 10:11:40','2011-06-04 10:11:40','<code class=\'debug_dump\'>{\"SERVER_SOFTWARE\"=>\"Apache/2.2.3 (CentOS)\", \"SERVER_PROTOCOL\"=>\"HTTP/1.1\", \"SERVER_NAME\"=>\"pomodorocrate.com\", \"SERVER_ADMIN\"=>\"tech@easymedia.ro\", \"SERVER_ADDR\"=>\"195.216.222.67\", \"SERVER_PORT\"=>\"80\", \"REMOTE_ADDR\"=>\"84.250.39.239\", \"REMOTE_PORT\"=>\"51269\", \"REQUEST_METHOD\"=>\"GET\", \"QUERY_STRING\"=>\"\", \"DOCUMENT_ROOT\"=>\"/var/www/vhosts/pomodorocrate.com/rails/pomodorocrate/current/public/\", \"REQUEST_URI\"=>\"/contact_requests/new\", \"SCRIPT_NAME\"=>\"\", \"PATH_INFO\"=>\"/contact_requests/new\", \"HTTP_HOST\"=>\"pomodorocrate.com\", \"HTTP_USER_AGENT\"=>\"Mozilla/5.0 (Windows NT 5.1; rv:2.0.1) Gecko/20100101 Firefox/4.0.1\", \"HTTP_ACCEPT\"=>\"text/html,application/xhtml+xml,application/xml;q=0.9,*/*;q=0.8\", \"HTTP_ACCEPT_LANGUAGE\"=>\"en-us,en;q=0.5\", \"HTTP_ACCEPT_ENCODING\"=>\"gzip, deflate\", \"HTTP_ACCEPT_CHARSET\"=>\"ISO-8859-1,utf-8;q=0.7,*;q=0.7\", \"HTTP_KEEP_ALIVE\"=>\"115\", \"HTTP_CONNECTION\"=>\"keep-alive\", \"HTTP_REFERER\"=>\"http://pomodorocrate.com/activities\", \"HTTP_COOKIE\"=>\"__utma=193383474.2129310431.1300606812.1307113526.1307180446.129; __utmz=193383474.1300951327.4.2.utmcsr=google|utmccn=(organic)|utmcmd=organic|utmctr=pomodorocrate; remember_token=BAhbB2kjIkVhZjU1MmIyMGUzMmQ2ZjJmY2YyMTNhZTI3MjYzY2Q4ZWZiY2Y5OTA2NWRkODkzNzE1NmE4ZTFkZTk3M2U3Z